INSERT INTO `plan_item_status` VALUES ('C', 'Completed', 'Course completed by member.', 'COMPLETED'), ('E', 'Enrolled', 'Enrolled in course, or accepted by member.', 'ENROLLED'), ('R', 'Recommended', 'Recommended by the system.', 'RECOMMENDED'), ('W', 'Withdrawn', 'Enrolled, but withdrawn and will not complete.', 'WITHDRAWN');
COMMIT;

-- ----------------------------
--  Table structure for `question`
-- ----------------------------
DROP TABLE IF EXISTS `question`;
CREATE TABLE `question` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `question_group_id` int(11) NOT NULL,
  `question_type_id` int(11) NOT NULL DEFAULT '0',
  `sort_order` int(11) NOT NULL,
  `number` varchar(40) DEFAULT NULL,
  `name` varchar(1024) DEFAULT NULL,
  `summary` varchar(500) DEFAULT NULL,
  `description` varchar(5000) DEFAULT NULL,
  `importance` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `question_group_id_index` (`question_group_id`),
  KEY `question_type_id_index` (`question_type_id`),
  CONSTRAINT `question_ibfk_1` FOREIGN KEY (`question_group_id`) REFERENCES `question_group` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Records of `question`
-- ----------------------------
BEGIN;
INSERT INTO `question` VALUES ('1', '1', '1', '1', '1', 'Patient Introduction', '<p>abc</p>', 'The pharmacy technician should be able to: <ul><li>Identify the patient</li><li>Introduce self to patient and explain their role</li></ul>', '1'), ('2', '1', '1', '2', '2', 'Patient Assessment', null, 'The pharmacy technician should be able to: <ul><li>Question the patient (parent or carer) or a health care professional to obtain information </li><li>Use a variety of information sources to gather information </li><li>Interpret records made by other health care professionals when appropriate</li><li>Identify if the patient has brought in their medicines and/or encourage medicines to be brought in</li></ul>', '1'), ('3', '1', '1', '3', '3', 'Patient Consent', null, 'For ward based pharmacy technicians, the main focus for obtaining patient consent is for using safe and/or removing unsafe Patients Own Drugs. This should follow the local process. As pharmacy technicians develop new roles and provide additional services they will require a greater understanding of the issues surrounding consent.', '1'), ('4', '1', '1', '4', '4', 'Relevant Medicines Management Information', null, 'During the consultation with the patient, health problems and medicines management background should be identified and documented as per local procedure. Medicines Management background information could include use of compliance aids, information on who usually fills this, need for large print labels, resident of a nursinghome requiring specific discharge instructions, support offered by social services etc. Identification of allergies and poor adherence.', '1'), ('5', '1', '1', '5', '5', 'Identification of Non-Adherence', null, 'Pharmacy technicians are ideally placed to identify patients with non-adherence to their medicines, such as an inability to use inhalers correctly, a fear of taking medications, or an inability to open clic locs or blister packs. These issues should be resolved and documented by the pharmacy technician or referred according to local policy.', '1'), ('6', '1', '1', '6', '6', 'Identification of Allergies', null, 'It is important patients do not receive medicines they allergic to, nor be exposed to products that contain substances they are allergic to eg latex or nuts (some topical preparations contain nut oils). A pharmacy technician should:  <ul><li>Ensure that any allergy identified, including the type of reaction, is documented according to local procedure </li><li>Review the prescription to ensure that no culprit medicines have been prescribed.</li><li>Refer any patients who are prescribed medicines to which they have a documented allergy according to local procedure.</li></ul>  Pharmacy technicians should also be aware some patients describe diarrhoea with antibiotics as being allergic to them.', '1'), ('7', '2', '1', '7', '1', 'Knowledge of Laws and Regulations', null, 'The member is familiar with pharmacy laws and regulations, especially as they pertain to pharmacy technician responsibilities.', '1'), ('8', '2', '1', '8', '2', 'Drug Enforcement Administration (DEA) Knowledge', null, 'The member is knowledgeable of the Drug Enforcement Administration (DEA) and state requirements for controlled substances: the candidate shall be able to identify controlled substance labels, understand the rationale for controlled substances, the need for proper inventory and accountability, and the proper storage of controlled substances.', '1'), ('9', '2', '1', '9', '3', 'Classification of Legend VS OTC', null, 'The member is knowledgeable of the Drug Enforcement Administration (DEA) and state requirements for controlled substances: the candidate shall be able to identify controlled substance labels, understand the rationale for controlled substances, the need for proper inventory and accountability, and the proper storage of controlled substances.', '1'), ('10', '2', '1', '10', '4', 'Pharmaceutical Vocabulary', null, 'The member demonstrates a thorough knowledge of general pharmaceutical and medical terminology, the apothecary symbols, abbreviations (English and Latin), and the common chemical symbols.', '1'), ('11', '3', '1', '11', '1', 'Prioritization', null, 'The technician should be able to prioritize his/her own work and adjust priorities in response to changing circumstances; for example, knowing which patients/tasks take priority. We recognise that it is not possible or necessary to review the pharmaceutical care of every patient, every day.', '1'), ('12', '3', '1', '12', '2', 'Punctuality', null, 'The pharmacy technician should ensure satisfactory completion of tasks with appropriate handover and recognise the importance of punctuality and attention to detail.', '1'), ('13', '3', '1', '13', '3', 'Initiative', null, 'The pharmacy technician should demonstrate initiative in solving a problem or taking on a new opportunity/task without the prompting from others, and demonstrate the ability to work independently within their limitations.', '1'), ('14', '3', '1', '14', '4', 'Efficiency', null, 'This section deals with time management, and the pharmacy technician should demonstrate efficient use of their time. An example could be reviewing the allocated patients in the given time to an appropriate standard.', '1'), ('15', '3', '1', '15', '5', 'Patient and Carer', null, 'The \"carer\" may be a friend or relative as well as a social services or private agency care worker.', '1'), ('16', '4', '2', '1', '1', 'Do all Pharmacy workstations, stock areas, will call, front/back counters and compounding appear neat, clean, organized and free of food/beverages?', null, null, '1'), ('17', '4', '2', '2', '2', 'Is the pharmacy fully staffed and are team members scheduled appropriately (peak days/ times)?', null, null, '1'), ('18', '4', '2', '3', '3', 'Partner with ETL-HR/ETL-Pharmacy and pull training meter report to determine if all team members have completed all required training?', null, null, '1'), ('19', '5', '2', '4', '1', 'Does staff member determine if guest/pet is a new or existing patient? (staff member should only offer paper patient profile, if requested)', null, null, '1'), ('20', '5', '2', '5', '2', 'Does staff member accurately select the correct patient from patient search using last and first name and DOB?', null, null, '1'), ('21', '5', '2', '6', '3', 'Does staff member verify that all patient information and maintenance tasks were correctly verified, including name, DOB, address, phone # and allergies?', null, null, '1'), ('22', '5', '2', '7', '4', 'Does staff member check on-hands to ensure that the quantity is in stock?', null, null, '1'), ('23', '5', '2', '8', '5', 'Does staff member select the correct Pick Up type (Urgent, Waiting, Shopping, Today, Future Date)?', null, null, '1'), ('24', '5', '2', '9', '6', 'If Refill, did the staff member complete patient maintenance tasks and let guests know they are out of refills and create an Open Call Queue to alert prescriber?', null, null, '1'), ('25', '5', '2', '10', '7', 'Does staff member ensure scan was successful and all relevant information is clearly captured on both sides of the prescription?', null, null, '1'), ('26', '5', '2', '11', '8', 'Does staff member place the hard copy prescription in the hard copy container?', null, null, '1'), ('27', '5', '2', '12', '9', 'Does staff member add the prescription to the queue to ensure proper prioritization?', null, null, '1'), ('28', '5', '2', '13', '10', 'If a prescription is called in from a prescriber or transferred, did only a pharmacist complete this task? (Pharmacist should use a blank prescription pad for all oral and transferred prescriptions)', null, null, '1'), ('29', '5', '2', '14', '11', 'If patient does not want a safety cap, does staff member select NO and scan a waiver form into Patient Info Image?', null, null, '1'), ('30', '6', '2', '15', '1', 'Does staff member review all notes associated with the prescription?', null, null, '1'), ('31', '6', '2', '16', '2', 'Does staff member accurately select DAW and enter all elements of the hard copy?', null, null, '1'), ('32', '6', '2', '17', '3', 'Does staff member search for prescribed drug (Drug Field) and select the right drug based on DAW? (Enter at least the first four letters of the drug name to get a better match)', null, null, '1'), ('33', '6', '2', '18', '4', 'Does staff member enter the correct date and prescriber written on the prescription?', null, null, '1'), ('34', '6', '2', '19', '5', 'Does staff member get clarification from the pharmacist, if they are unclear or don\'t understand hard copy image?', null, null, '1'), ('35', '6', '2', '20', '6', 'Does staff member provide notes that are related to the drug, if necessary?', null, null, '1'), ('36', '6', '2', '21', '7', 'Does staff member reject the order if review is required or if they need more information?', null, null, '1'), ('37', '6', '2', '22', '8', 'Does staff member properly handle any third party rejects/warnings and make any necessary edits?', null, null, '1'), ('38', '6', '2', '23', '9', 'Does staff member obtain a white or red basket based on Pick Up type?', null, null, '1'), ('39', '7', '2', '24', '1', 'Does staff member start fill task in order of priority? v', null, null, '1'), ('40', '7', '2', '25', '2', 'Does staff member obtain stock bottle from shelf, scan user barcode, scan thelabel, scan the stock bottle and wait for a positive beep and green light to confirm accuracy?', null, null, '1'), ('41', '7', '2', '26', '3', 'Does same staff member fill all prescriptions in order and complete only one order at a time? (Team member should not batch orders)', null, null, '1'), ('42', '7', '2', '27', '4', 'Does staff member pullbottle, count and measure and label correctly according to quantity field?', null, null, '1'), ('43', '7', '2', '28', '5', 'For liquid dosage form, did staff member select the correct dispensing device? (PIBA, syringe)', null, null, '1'), ('44', '7', '2', '29', '6', 'Does staff member accurately prepare order for pharmacist verification and immediately return the stock bottle to the shelf? (if unit of use stock bottle, staff membershould include stock bottle for verificatio', null, null, '1'), ('45', '7', '2', '30', '7', 'Does staff member update expiration, if necessary? (Topicals, Liquids, etc.)', null, null, '1'), ('46', '8', '2', '31', '1', 'Does Pharmacist initiate task by scanning thebottle label?', null, null, '1'), ('47', '8', '2', '32', '2', 'Does Pharmacist review all notes provided during order/data entry?', null, null, '1'), ('48', '8', '2', '33', '3', 'Does Pharmacist accurately complete seven point check? (Patient, DUR, SIG, Quantity, Prescriber, DAW) by reviewing the information against scanned hardcopy image.', null, null, '1'), ('49', '8', '2', '34', '4', 'Does Pharmacist open the bottle and validate that the product matches drug image as well as product name, appearance, quantity?', null, null, '1'), ('50', '8', '2', '35', '5', 'Does Pharmacist evaluate all DURs and drug therapy issues and take appropriate action as needed? (Medication Review; Call Doctor or add notes when they override a DUR)', null, null, '1'), ('51', '8', '2', '36', '6', 'Does Pharmacist reject the prescription correctly and select the right reason code if errors were found? (Sent Back to Data Entry by selecting Return to Data Entry for Correction)', null, null, '1'), ('52', '8', '2', '37', '7', 'Does Pharmacist add notes or remove for prescription for this fill or all fills, if needed? Counseling Required? Different generic than previous fill?', null, null, '1'), ('53', '8', '2', '38', '8', 'Did Pharmacist select the correct will call bin for placement? (Bulk/Fridge/Mix/Will Call)', null, null, '1'), ('54', '8', '2', '39', '9', 'Were prescriptions filed in appropriate will call section by using guest\'s last name in each section? Did team clip multiple prescriptions for the same guest?', null, null, '1'), ('55', '9', '2', '40', '1', 'Does staff member obtain and search the first, last name and DOB of the patient in Will Call from screen and determine number of prescription to be picked up?', null, null, '1'), ('56', '9', '2', '41', '2', 'Does staff member check screen for any release notes and offere counseling by pharmacist? (pharmacy services, auto-refill)', null, null, '1'), ('57', '9', '2', '42', '3', 'Does staff member correctly retrieve the prescription from the correct location? (Fridge/Bulk/ Mix/Will Call)', null, null, '1'), ('58', '9', '2', '43', '4', 'Does staff member remove contents of bag and verify order by reviewing patient name, DOB, address, phone number, and that product matches what patient is expecting?', null, null, '1'), ('59', '9', '2', '44', '5', 'Does staff member determine if counseling is required and alert the Pharmacist?', null, null, '1'), ('60', '9', '2', '45', '6', 'If counseling is required or requested, does Pharmacist provide counseling? (Counseling should offered on all new prescriptions)', null, null, '1');
COMMIT;

